import React from "react";
import LoadingScreen from "./loading";

export default class EntityFieldGroups extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        if (this.props.sections) {
            return (
                this.props.sections.map((section, index) => {
                    return (
                        <div className="entity-field-group" key={index}>
                            <div className="entity-field-group-header">
                                <h3>{section.name}</h3>
                            </div>
                            <div className="entity-field-group-body">
                                {section.fields.map((field, index) => {
                                    return (
                                        <div className="entity-field" key={index}>
                                            <div className="entity-field-label">
                                                <label>{field.label}</label>
                                            </div>
                                            <div className="entity-field-value">
                                                {field.value}
                                            </div>
                                        </div>
                                    )
                                })}
                            </div>
                        </div>
                    )
                })
            );
        } else {
            // loading screen
            return <LoadingScreen/>
        }
    }
}
